package org.codeship.slidingwindow.fixedsize;

import java.util.HashMap;
import java.util.Map;

// 80/90 test cases passed on GFG
public class CountOccurencesOfAnagrams1 {

	public static int search(String pat, String txt) {
		
		//count the occurrences of all characters from pat string, and put into hmap1
    	Map<Character, Integer> hmap1 = new HashMap<>();
    	for(int k=0; k<pat.length(); k++) {
    		char ch = pat.charAt(k);
    		hmap1.put(ch, hmap1.getOrDefault(ch, 0)+1);
    	}
    	System.out.println(hmap1);
    	
    	int i = 0, j = 0;
    	int count = 0;
    	int k = pat.length();
    	boolean isContain = true;
    	Map<Character, Integer> hmap2 = new HashMap<>();
    
    	while (j < txt.length()) {
    		//calculation
    		//count the occurrences of character at jth index for current window and put into hmap2
    		char tempchar = txt.charAt(j);
    		hmap2.put(tempchar, hmap2.getOrDefault(tempchar, 0)+1);
    		
    		if(j-i+1 < k) { ////window size is less than k
    			j++;
    		} else if(j-i+1 == k) { //window size is equal to k.
    			
    			//if hmap1 & hmap2, both's size are equal then iterate through keys of hmap2 & 
    			//check whether each key is present in hmap1 or not, if yes then compare the value of that
    			//key from both map with each other value, if it is equal means then continue the loop otherwise 
    			//break from the loop
    			if(hmap1.size() == hmap2.size()) {
    				for(char key: hmap2.keySet()) {
    					if(!hmap1.containsKey(key)) {
    						isContain = false;
    						System.out.println("j: "+ j + " " + hmap2);
    						break;
    					}
    					else if(hmap1.containsKey(key) && hmap1.get(key) == hmap2.get(key)) {
    						isContain = true;
    					}
    					else if(hmap1.containsKey(key) && hmap1.get(key) != hmap2.get(key)) {
    						isContain = false;
    						System.out.println("j: "+ j + " " + hmap2);
    						break;
    					}
    				}
    				if(isContain) {
    					System.out.println("inside is contain");
    					count++;
    				}
    			}
    			
    			//get the character at ith index & reduce its value from hamp2 if its value of ch
    			//is greater than 1, otherwise remove ch from hmap2
    			char chh = txt.charAt(i);
    			if(hmap2.get(chh) > 1) {
    				hmap2.put(chh, hmap2.get(chh)-1);
    			} 
    			else {
    				hmap2.remove(chh);
    			}
    			i++;
    			j++;
    		}
    	}
    	return count;
   }
	
	public static void main(String[] args) {
		String txt = "";
		String pat = "";
		System.out.println(search(pat, txt));

	}

}
